import React from 'react';
import { NavLink } from 'react-router-dom';
import Footer from '../components/Footer';
import Navigation from '../components/Navigation';

const Mochi = () => {
    return (
        <div className="mochi">
            <Navigation />
            <div className="container">
            <h2>Mochi</h2>
            <div className="cat6">
            <div className="img-cat6"></div>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Officiis voluptates, beatae inventore libero placeat temporibus corrupti minima blanditiis reiciendis ad impedit consequuntur atque unde exercitationem explicabo. Temporibus error ullam eaque repellat exercitationem mollitia earum nisi quaerat officia, nobis, iure natus.</p>
            <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Quia sed dolores nam nemo aliquam? Placeat dicta ad cupiditate nemo molestias, doloribus modi debitis eligendi. Sequi, id.</p>
            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Alias qui sint molestias rem? Inventore sit maiores officiis in vero corporis consequatur, rem debitis at dicta quam veniam consequuntur accusantium neque voluptatem ratione enim! Hic dignissimos tenetur minima.</p>
            </div>
            </div>
           <Footer />
        </div>
    );
};

export default Mochi;
